// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';
import GoogleMapsPage from './GoogleMapsPage';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Torrin Conrath</h1>
        </header>

        <section className="App-section">
          <h2>Projects</h2>
          <div className="project">
            <h3>React Webpage using Google Maps API</h3>
            <Link to="/google-maps">Explore Google Maps</Link>
          </div>
        </section>

        <section className="App-section">
          <h2>Contact</h2>
          <p>Email: torrin@vt.edu</p>
          <p>LinkedIn: <a href="https://www.linkedin.com/in/torrin-conrath-31b29a252/" target="_blank" rel="noopener noreferrer">LinkedIn</a></p>
          <p>GitHub: TBA</p>
        </section>

        <footer className="App-footer">
          <p>Â© 2024 Torrin Conrath</p>
        </footer>

        <Routes>
          <Route path="/google-maps" element={<GoogleMapsPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
